import React from 'react'
import { slide as Menu } from 'react-burger-menu';

export default function Sidebar() {
    return (
        <Menu>
        <a className="menu-item" href="/">
          Home
        </a>

        <a className="menu-item" href="/laravel">
          Laravel
        </a>
      </Menu>
    )
}
